  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Sand Lake Migratory
  Waterfowl Refuge outlines Refuge accomplishments from August through October of
  1938. The report begins by summarizing the weather conditions and water conditions
  during this period. Wildlife- including migratory birds, upland game birds, predators,
  rodents, and raptors- is also covered. The Refuge development and maintenance section
  discusses physical developments and plantings. Resource management is outlined;
  topics include haying. The public relations section of the report describes recreational
  uses and Refuge visitors. Photographs are attached.\",\n\t\"license_title\": \"License
